import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import TicketSystem from "./components/ticket-system";
import TicketGrid from "./pages/ticketpage";
import AdminPanel from "./components/admin-panel";

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<RaffleTicketSystem />} />
        <Route path="/tickets/session/:uniqueId" element={<TicketGrid />} />
        <Route path="/search " element={<AdminPanel/>}/>
      </Routes>
    </Router>
  );
};

export default App;
